import React, { useEffect } from "react";

const Single_ReviewData = ({target}) => {

    console.log(target)

    return <React.Fragment>

        <div
        style={{
            width:'80%',
            display:'grid',
            gridAutoFlow: 'row',
            // justifyItems: 'center',
            alignItems: 'center'
        }}
        >
            <div>
            {target.id}
            </div>

            <div>
            {target.user.name}
            </div>
            
            <div
            style={{
                width:'50%',
                letterSpacing: '1.5px',
                wordSpacing: '1px',
                lineHeight: '3.5vh',
                whiteSpace: 'pre-wrap',
                overflowWrap: 'break-word'
            }}
            >
            {target.user_post_text}
            </div>


        </div>

    </React.Fragment>



}

export default Single_ReviewData
